drop database if exists vehiculos;
create database vehiculos;
use vehiculos;


--
-- Table structure for table `coches`
--

DROP TABLE IF EXISTS `coches`;

CREATE TABLE `coches` (
  `Id` int(11) NOT NULL,
  `Marca` varchar(50) DEFAULT NULL,
  `Modelo` varchar(100) DEFAULT NULL,
  `Consumo` float(5,2) DEFAULT NULL,
  `Emisiones` int(11) DEFAULT NULL,
  `Imagen` varchar(100) DEFAULT NULL, # Se define la url de la imagen. Como no tenemos esas imágenes, no podremos visualizarlas.
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


