-- Modelos de vehículos TDI
select * from coches where modelo like "%TDI%";

-- Modelos de la marca 'Audi' y de la marca 'Seat' ordenado por Marca y Modelo.
select marca, modelo from coches where marca in ('Audi', 'Seat') order by marca, modelo;

-- Marcas de Vehículos que empiecen por T y terminen en a.
select * from coches where marca like "T%a_"; 

-- Vehículos que tengan foto.
select imagen from coches where imagen like "%.bpm";

-- El consumo de los vehículos está expresado en litros/1OOkm. Listar el consumo de los vehículos 'Seat' en MPG, Millas por galón (10 MPG=23.52 l/1OOkm).
select consumo * 10 / 23.52 from coches where marca = 'seat';

-- Mostrar los vehículos, ordenados por consumo, que cumplan que tienen un consumo menor de 4, sus emisiones son menores que 110, que no tengan imagen y que no sean de la marca Volkswagen
select * from coches;
select * from coches where consumo < 4 and emisiones < 110 and imagen like ' '  and marca <> 'Volkswagen' order by consumo;

-- Mostrar todos los vehículos y añadir una columna que indique 'Poco contaminante' 
-- si las emisiones son <110. 'Bastante contaminante' si el consumo es entre 110 y 150. Utilizar else para el resto indicando 'No comprar, atentado ecológico' .
select *;
case when emisiones  < 110 then 'Poco contaminante' when emisiones between 110 and 150 then 'Bastante contaminante' else 'No comprar, atentado ecológico' end from coches;

-- Los datos de los vehículos cuyo consumo sea menor que el consumo del coche con ID 25
select * from coches where consumo < (select id from coches where id = 25);

-- Los datos de los vehículos cuyas emisiones sea mayor o igual que las emisiones del vehículo con ID 25 y al mismo tiempo cuyo consumo sea menor que 6
select * from coches where Emisiones >= (select emisiones from coches where id = 25) and (consumo  < 6);

